import React, { useRef } from 'react'
import { useGLTF, useAnimations } from '@react-three/drei'

export function WhitePill(props) {
  const group = useRef()
  const { nodes, materials, animations } = useGLTF('/WhitePill/WhitePill.gltf')
  const { actions } = useAnimations(animations, group)
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="WhitePill" geometry={nodes.WhitePill.geometry} material={materials['Material.005']} position={[-0.4, 1.32, 0]} rotation={[1.88, 0, -Math.PI / 2]} scale={0.75}>
          <meshStandardMaterial color="white"/>
          <mesh name="MovingBlock1" geometry={nodes.MovingBlock1.geometry} material={materials['Material.004']} position={[0, 1.94, -0.02]} rotation={[-2.68, -0.87, 1.99]} scale={0.83} />
        </mesh>
      </group>
    </group>
  )
}

